import "slick-carousel/slick/slick-theme.css";
import art1 from "../../images/female-faces/Female/Female-05.svg";
import art2 from "../../images/female-faces/Female/Female-07.svg";
import art3 from "../../images/female-faces/Female/Female-16.svg";

const Carousel = () => {
  const settings = {
    dots: true,
    infinite: true,
    speed: 500,
    slidesToShow: 1,
    slidesToScroll: 1,
  };



  return (
    <div className="carousel-mobile">
      {/* CAROUSEL START*/}

      <Slider {...settings}>

      {images.map((image) => {
        return (
        <div>
          <img className="carousel-image" src={image} alt="" />
          <a href="/">
            <h2 className="card__title">Food & Drink</h2>
          </a>
        </div>
        )
      })}

      </Slider>

      {/* CAROUSEL END*/}
    </div>
  );
};

export default Carousel;
